void generate_bombs()
{
    for(int i=1;i<=10;i++)
    {
        for(int j=1;j<=10;j++)
        {
            grid[i][j] = 0;
            vis[i][j] = 0;
        }
    }
    int bomb[2][10];
    for(int i=0;i<10;i++)
    {
        bomb[0][i] = 0;
        bomb[1][i] = 0;
    }
    // Define a 2D array to store the pairs

    // Generate and store unique pairs of values
    int count = 0;
    while (count < 10) {
        int x = rand() % 10 + 1;
        int y = rand() % 10 + 1;

        // Check if the pair already exists
        int exists = 0;
        for (int i = 0; i < count; i++) {
            if (bomb[0][i] == x && bomb[1][i] == y) {
                exists = 1;
                break;
            }
        }

        // If the pair doesn't exist, store it
        if (!exists) {
            bomb[0][count] = x;
            bomb[1][count] = y;
            count++;
        }
    }
    // for(int i=0;i<10;i++)
    // {
    //     printf("%d ",bomb[0][i]);
    //     printf("%d ",bomb[1][i]);
    //     printf("\n");
    // }
    for(int i=0;i<10;i++)
    {
        int x = bomb[0][i];
        int y = bomb[1][i];

        grid[x][y] = -1;
        if(x > 1 && grid[x-1][y] != -1)           grid[x-1][y]++;
        if(y > 1 && grid[x][y-1] != -1)           grid[x][y-1]++;
        if(x < 10 && grid[x+1][y] != -1)          grid[x+1][y]++;
        if(y < 10 && grid[x][y+1] != -1)          grid[x][y+1]++;
        if(x > 1 && y > 1 && grid[x-1][y-1] != -1)  grid[x-1][y-1]++;
        if(x > 1 && y < 10 && grid[x-1][y+1] != -1) grid[x-1][y+1]++;
        if(x < 10 && y > 1 && grid[x+1][y-1] != -1) grid[x+1][y-1]++;
        if(x < 10 && y < 10 && grid[x+1][y+1] != -1)grid[x+1][y+1]++;
    }

    // for(int i=1;i<=10;i++)
    // {
    //     for(int j=1;j<=10;j++)
    //     {
    //         printf("%d ",grid[i][j]);
    //     }
    //     printf("\n");
    // }

    // printf("%d\n",grid[1][7]);
}

