void update_zero(int x,int y)
{
    if(grid[x][y] == 0)
    {
        print_0(x,y);
        printf("%d ",x);
        printf("%d ",y);
        printf("\n");
        if( x > 1 && grid[x-1][y] != -1                && vis[x-1][y] != 1 )   update_zero(x-1,y);
        if( y > 1 && grid[x][y-1] != -1                && vis[x][y-1] != 1 )   update_zero(x,y-1);
        if( x < 10 && grid[x+1][y] != -1               && vis[x+1][y] != 1 )   update_zero(x+1,y);
        if( y < 10 && grid[x][y+1] != -1               && vis[x][y+1] != 1 )   update_zero(x,y+1);
        if( x > 1  && y > 1 && grid[x-1][y-1] != -1    && vis[x-1][y-1] != 1 ) update_zero(x-1,y-1);
        if( x > 1  && y < 10 && grid[x-1][y+1] != -1   && vis[x-1][y+1] != 1 ) update_zero(x-1,y+1);
        if( x < 10  && y > 1 && grid[x+1][y-1] != -1   && vis[x+1][y-1] != 1 ) update_zero(x+1,y-1);
        if( x < 10  && y < 10 && grid[x+1][y+1] != -1  && vis[x+1][y+1] != 1 ) update_zero(x+1,y+1);
    }
    else if(grid[x][y] != 0)
    {
        if(grid[x][y] == 1)      print_1(x,y);
        else if(grid[x][y] == 2) print_2(x,y);
        else if(grid[x][y] == 3) print_3(x,y);
        else if(grid[x][y] == 4) print_4(x,y);
        else if(grid[x][y] == 5) print_5(x,y);
        else if(grid[x][y] == 6) print_6(x,y);
        else if(grid[x][y] == 7) print_7(x,y);
        else if(grid[x][y] == 8) print_8(x,y);
    }
}
void flag()
{
    if(vis[cx][cy] == 0)
    {
        vis[cx][cy] = 2;
        flags++;
    }
    else if(vis[cx][cy] == 2)
    {
        vis[cx][cy] = 0;
        flags--;
    }

    print_flag(cx,cy);
}

void win_check()
{
    int cnt = 0;
    for(int i=1;i<=10;i++)
    {
        for(int j=1;j<=10;j++)
        {
            if(vis[i][j] == 1)
            {
                cnt++;
            }
        }
    }
    if(cnt == 90)
    {
        print_win();
    }
}

void game()
{
    clear_screen();
    clear_char();
    clear_seg7();
    cx = 1;
    cy = 1;
    int width = 200;
    int x = 60;
	int y = 20;
    for(int j=0;j<=10;j++) 
    for(int i=x;i<=x+width;i++)
    write_pixel(i,y + 20*j,0x0000);
	for(int i=0;i<=10;i++)
	for(int j=y;j<=y+width;j++)
	write_pixel(x + 20*i,j,0x0000);
    // initialise cursor
    for(int i=0;i<=20;i++) write_pixel(x+i+(cy-1)*20,   y+(cx-1)*20,       0x0fff);
    for(int i=0;i<=20;i++) write_pixel(x+(cy-1)*20,     y+i+(cx-1)*20,     0x0fff);
    for(int i=0;i<=20;i++) write_pixel(x+i+(cy-1)*20,   y+20+(cx-1)*20,    0x0fff);
    for(int i=0;i<=20;i++) write_pixel(x+20+(cy-1)*20,  y+i+(cx-1)*20,     0x0fff);
    volatile int* switch_ptr = (int *) 0xFF200040; 
	volatile int * key = (int *)0xFF200050;
	generate_bombs();
    while(1)
    {
        display_time();
        if((*key) == 1)
        {
            move_right();
            
            moves++;
            if(moves%10 == 0)t++;
        }
        else if((*key) == 2)
        {
            move_down();
           
            moves++;
            if(moves%10== 0)t++;
        }
        else if((*key) == 4)
        {
            move_up();
            
            moves++;
            if(moves%10 == 0)t++;
        }
        else if((*key) == 8)
        {
            move_left();
           
            moves++;
            if(moves%10 == 0)t++;
        }
        else if((*switch_ptr) == 4 && vis[cx][cy] != 1)
        {
            flag();
            for(int d = 0;d<4*1000000;d++);
            clicks ++;
            moves++;
            if(moves%10 == 0)t++;
        }
        else if((*switch_ptr) == 2 && vis[cx][cy] != 1 && vis[cx][cy] != 2)
        {
            update();
            win_check();
            for(int d = 0;d<4*1000000;d++);
            clicks ++;
            moves++;
            if(moves%10 == 0)t++;
        }
        else
        {
            for(int d = 0;d<4*1000000;d++);
            moves++;
            if(moves%10 == 0)t++;
        }
    }

}

int main()
{
    clear_screen();
    clear_char();
    clear_seg7();
    srand(time(0));
    volatile int* switch_ptr = (int *) 0xFF200040; 
	//printf("%d",*switch_ptr);
    while(1)
    {
        print_start();
        if( *switch_ptr == 1)
        {
            game();
            break;
        }
    }

    return 0;   
}


